import React, { Fragment } from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { Grid, Paper, Typography } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    paper: {

    },
}));

function EnA() {

    const classes = useStyles();

    return (
        <Fragment>
            <Typography align="center">
                Looking for some easy-going fun or rainy day cover? 
                Maybe some mini-golf, go-karts, gem mining, an escape 
                room, a newly released movie, or a good old game of 
                billiards? From billiards to climbing walls to gem mines, 
                the listings below will help you find all the entertainment 
                and amusements you need for a fun-filled day in Boone.
            </Typography>
            <Paper>
                <Grid container>
                    <Grid xs={4}>

                    </Grid>
                    <Grid xs={8}>
                        <Typography variant="h4">
                            10 HIGH COUNTRY LANES
                        </Typography>
                        <Typography variant="h6">
                            BOONE
                        </Typography>
                        <Typography>
                            High Country Lanes features 16 lanes of friendly 
                            bowling fun. Come and visit the beautifully 
                            remodeled bar and check out local beers, a new 
                            menu, and a full service bar. Enjoy the game, 
                            food, and drinks at your station or on the patio. 
                            Birthdays, corporate events, and other private 
                            parties are welcome.
                        </Typography>
                        <Typography variant="h5">Details</Typography>
                    </Grid>
                </Grid>
            </Paper>
        </Fragment>
    );
}

export default EnA;
